import React from 'react';
import {useForm} from 'react-hook-form';
import './sign-up.css'

//find out cum sa fac sa tin minte in acel obiect si token si sa salvez toate astea in Useri

export default function SignUp(){
  const {register, handleSubmit, formState: {errors}} = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);

  return (
    <div className='sign-up'>
      <h1>Sign Up</h1>

      <form onSubmit={handleSubmit(onSubmit)}>
        <input type="text" placeholder='Name' {...register('Name', {required:true, maxLength:80})}/>
        <input type="text" placeholder='Username' {...register('Username', {required:true, maxLength:80})} />
        <input type="password" placeholder='Password' {...register('Password', {required:true, maxLength:9})} />
        <p><small>The password input requires a max of 8 characters.</small></p>
        <input type="submit" />
      </form>
    </div>
  )
}
